Die Söhne Gads waren nach ihren Familien: Sephon, von welchem die Familie der Sephoniter; Aggi, von welchem die Familie der Aggiter; Suni, von welchem die Familie der Suniter;
Ozni, von welchem die Familie der Ozniter; Her, von welchem die Familie der Heriter;
Arod, von welchem die Familie der Aroditer: Ariel, von welchem die Familie der Arieliter herstammt.
